def traitercourbe(H):  #done et marche bien 
    L1=[]
    for i in H:  
        if i<-90:
            L1.append(i+180)
        elif i>90:
            L1.append (i-180)
        else:
            L1.append(i)
    return L1
    #ce systme permet de traiter les listes , en cetrant les valeurs sur 0 (expliquer le probme de la centrale inertielle)

def courbes(L,A=None,B=None,C=None,D=None):  #done et marche bien 
    #plt.close()#Affichage de la droite de rgression et des points
    for H in (L,A,B,C,D):
        if H is not None:  
            L1=traitercourbe(H)
            X=np.linspace(0,len(L1)*dt, len(L1))
            Y=np.array(L1)
            plt.plot(X,Y)
            plt.grid()
            plt.xlabel('Axe des temps en [s]') 
            plt.ylabel('acquisition de l''angle 180-alpha')
    plt.show()#ce systme permet d'afficher les courbes traites 
    
def periode(liste): #done et marche bien 
    L=traitercourbe(liste) #traiter la liste 
    indzeros=[] #les indices ou la courbe s'annule 
    for i in range(len(L)-1):  #reperer les indices d'annulation 
        if L[i]*L[i+1]<=0:
            indzeros.append(i)
    periode=[] #liste des periodes
    for i in range(len(indzeros)-2): #calculer la periode 
        periode.append(dt*(indzeros[i+2]-indzeros[i]))
    MoyT=np.mean (periode) #la valeur moyenne de la periode 
    periodef=[]  # filtrer les valeurs des periodes non raisonnables
    for T in periode: 
        if T>=MoyT*0.75 and T<= MoyT*1.25:
            periodef.append(T)
    return np.mean(periodef) #donner la valeur moyenne raisonnable

#on applique un filtre passe bas pour lisser la courbe et la rendre plus exploitable, les bruits d'aquisition seront attnus  

def filtrercourbes(L):#done et marche bien
    wc=3*(2*np.pi/periode(L)) #frquence de coupure/de filtrage , elle est gale  3 fois la frquence d'osiccaltion
    LN=traitercourbe(L) #courbe traite ou ramene  0 
    s=[LN[0]] # boucle qui donne s: les valeeurs filtres 
    for i in range(0,len(LN)-1):
        s.append(LN[i]*wc*dt+s[i]*(1-wc*dt))
    X=np.linspace(0,len(LN)*dt, len(LN))
    #plt.plot(X,s)
    #plt.xlabel('courbe filtre')
    #plt.plot(X,LN)
    #plt.grid()
    #plt.show()
    return s     # courbe filtre et bruit limi

#le filtrage de la courbe implique un dphasage et une attnuation d'amplitude pour cela on utilise la fonction depht pour calculer le dphasage dans le temps Cette fonction permet d'avoir une rgression plus prcis  dt prs  

def depht(L): #done et marche bien // cette fonction permet de calculer le dphasage en temps pour la courbe filtrer  
    CF=filtrercourbes(L)#courbe filtre
    C=traitercourbe(L) #courbe normale 
    # processus de reperage les indices d'annulation de la courbe originale et filtre  
    indzerosF=[] #les indices pour lesquels la courbe filtre s'annule 
    indzerosC=[] #les indices pour lesquels la courbe originale s'annule  
    for i in range(len(CF)-1):  
        if CF[i]*CF[i+1]<0:
            indzerosF.append(i)
    for i in range(len(C)-1):  
        if C[i]*C[i+1]<0:
            indzerosC.append(i)
            
    depht=[] #cette liste contient chaque dphasage existant 
    for i in range(min(len(indzerosC),len(indzerosF))):
        depht.append(dt*abs(indzerosF[i]-indzerosC[i]))
    
    #pour prendre que les valeurs significatives on prend que les valeurs autour de la valeur moyenne, les valeurs loing de cette valeure seront limin 
    moydepht=np.mean(depht)#valeur moyenne avant brut   
    dephtF=[]
    moydepht=np.mean(depht)
    for deph in depht:                                                                                                                                                                                                                    
        if deph>=moydepht*0.5 and deph<=moydepht*1.5: 
            dephtF.append(deph)
           # print(str(deph))
    return int((0+np.mean(dephtF))//dt)*dt #valeur moyenne nette du dphasage approxime aux chiffres sgnificatifs de dt 

#la fonction correction_courbe_filtree permet de rgler ce dphasage et utilise un correcteur (gain pour corriger l'amplitude ,  la fin de cette fonction la courbe sera parfaitement exploitable  

def correction_courbe_filtree (L): #done et marche bien 
    LF=filtrercourbes(L) #courbe aprs filtrage
    #Kcor=max(traitercourbe(L))/max(LF)
    Kcor=(np.sqrt(1+1/9)) #correcteur de l'amplitude en gain
    #print(Kcor)
    LF=[i*Kcor for i in LF] #courbe filtr corrige en amplitude
    deltat=depht(L) #dphasage en temps 
    X1=np.linspace(0,len(L)*dt,len(L)) # courbe du temps 
    X=[i-deltat for i in X1] # rgler le dphasage en temps
    #ppp=X[0]
    #X=[i-ppp for i in X]
    #print (X[0]) 
    #plt.plot(X1,traitercourbe(L)) # afficher courbe originale
    #plt.plot(X,LF) # afficher courbe filtre corrige
    return LF #courbe filtre corrige

def estsommet(s,i):#done et marche bien 
    if s[i]>s[i+1] and s[i]>s[i-1] and s[i]>s[i+2] and s[i]>s[i-2] and  s[i]>s[i+3] and s[i]>s[i-3] and s[i]>s[i+4] and s[i]>s[i-4]:
        return True
    else:
        return False
    #permet de vrifier si le point d'indexe i est un sommet de s , s doit tre la liste filtre 

def courbe_et_enveloppe(L): #done et marche bien 
    s=correction_courbe_filtree(L)
    #processus de detrmination des indexes de sommets 
    indsommet=[]
    for i in range(4,len(s)-4):
        if estsommet(s,i):
            indsommet.append(i)
    #processus d'affichage des sommets 
    Yr=[]#les valeurs des sommets
    Xr=[]#les instants correspondants aux sommets 
    for i in range(len(indsommet)):# remplissage de Yr et Xr
        Yr.append(s[indsommet[i]])
        Xr.append(dt*indsommet[i])
    lnYr=[np.log(i) for i in Yr]
    # coeficient de regression # l'enveloppe est sous la forme ( exp((-a*t)+b))
    a,b=np.polyfit(Xr,lnYr,1)
    a=-a # coeficient de regression # l'enveloppe est sous la forme ( exp((-a*t)+b)) 
    X=np.linspace(0,dt*len(s),len(s)) 
    enveloppe=[np.exp(-a*i*dt)*np.exp(b+a*depht(s)) for i in range(len(s))] #les valeurs de l'enveloppe d'aprs la regression
    plt.figure(' la courbe et son enveloppe associ')
    plt.plot(X,s) 
    plt.plot(Xr,Yr)#afficher le parcour des sommets dtectes 
    plt.plot(X,enveloppe)#afficher l'enveloppe
    plt.figure('la regression')
    plt.plot(Xr,lnYr,'*',X,[-a*i*dt+b for i in range(len(X))],'-r')
    plt.grid()
    plt.show()
    
    return a #a='Xi*W0 
