def regression(L): #done et marche bien 
    s=correction_courbe_filtree(L)
    #processus de detrmination des indexes de sommets 
    indsommet=[]
    for i in range(4,len(s)-4):
        if estsommet(s,i):
            indsommet.append(i)
    #processus d'affichage des sommets 
    Yr=[]#les valeurs des sommets
    Xr=[]#les instants correspondants aux sommets 
    for i in range(len(indsommet)):# remplissage de Yr et Xr
        Yr.append(s[indsommet[i]])
        Xr.append(dt*indsommet[i])
    lnYr=[np.log(i) for i in Yr]
    # coeficient de regression # l'enveloppe est sous la forme ( exp((-a*t)+b))
    a,b=np.polyfit(Xr,lnYr,1)
    a=-a # coeficient de regression # l'enveloppe est sous la forme ( exp((-a*t)+b)) 
    return a #a=Xi*W0 
def Xi_w0(L): #done et marche bien 
    XiW0,Wr=regression(L),2*np.pi/periode(L) # extraire Xi*W0 et la pulsation 
    W0=np.sqrt(Wr**2+XiW0**2) # la pulsation propre
    Xi=XiW0/W0 # coefficient d'amortissement 
    return Xi,W0 # ce program permet de determiner le coeficient d'amortissemnt  partir d'une acquisition de valeur

def f_A1(L):#done et marche bien 
    xi,W0=Xi_w0(L)
    A1=m1*g*lg1/(W0**2)
    f=xi*2*W0*A1
    return f,A1 #ce programe permet de determiner les coefficinets f et At

def detectersommet(L):
    Z=[]# listes de Xi
    ind=[]
    L1=correction_courbe_filtree(L)
    X=np.linspace(0,len(L1)*dt, len(L1))
    Y=np.array(L1)
    plt.plot(X,Y)#afficher la courbe relle
        
    lesind=[0]*len(L1)
    for i in range(4,len(L1)-4):
        if estsommet(L1,i):
            ind.append(i)
            lesind[i]=L1[i]
            lesind[i-1]=L1[i-1]
            lesind[i-2]=L1[i-2]
            lesind[i+1]=L1[i+1]
            lesind[i+2]=L1[i+2]
            
            D=abs((L1[i])/np.pi)
            Z.append(1/np.sqrt(1+np.pi**2*len(ind)**2/(np.log(D)**2))) 
    plt.plot(X,lesind)
    plt.grid()
    plt.show()
    return Z, np.mean(Z[:3]) 
